lyr.f[0].a = [11,"大黑松小倆口牛軋糖創意博物館",null,"北部","新北市","土城","新北市土城區自強街31之2號","02-22687222",121.432732,24.97193,"參觀人數已突破120萬人、65個國家、2萬臺車次，館內展示臺灣早期牛軋糖的製程、婚禮用品，以「臺灣古早味風格」呈現，規劃「孝親大道」，期望喚起年輕E世代人「飲水思源」與「孝親」的中國傳統美德。","http://www.9420.com.tw"];
lyr.f[1].a = [13,"手信坊創意和菓子文化館",null,"北部","新北市","土城","新北市土城區國際路55號","02-82620506",121.466603,24.977821,"手信坊將日本和菓子不同的多元文化加以融入，創造屬於「臺灣本土新一代的菓子」，我們稱為 『創意和菓子』。DIY製菓學園邀請大家一起親身體驗和菓子的極致之美。","http://www.3ssf.com.tw"];
lyr.f[2].a = [14,"王鼎時間科藝體驗館","鐘錶","北部","新北市","土城","新北市土城區大暖路136號","02-22682999#12",121.423672,24.955976,"王鼎是以時間為主題的時間科藝體驗館，積極轉型創立ATOP World Time世界時區錶更獲得世界產品設計大賞。傳達計時器的歷史與演進、專利技術展現、鐘錶製程參觀與實際動手組裝體驗，是一座融合時間知識、科學與藝術的時間殿堂。","http://www.atopwatch.com/factory/"];
